import Head from "next/head";
import Styled from "styled-components";
import { Flex, Box } from "rebass";
import AdSense from "react-adsense";

// Get components
import Navigation, {
  CachetteNavigation
} from "../src/components/navigation/components";
import FixedFooterNavigation from "../ui/navigation/components/fixed-footer-navigation";
import AdWrapper from "../ui/adWrapper/components/index";
import LeagueContainer from "../ui/league-container/components/league-container";
import GameInfoComponent from "../ui/game-info/components/game-info-component";
import Footer from "../ui/footer/components";

const Home = () => {
  return (
    <Fragment>
      <Head>
        <title>Oddschecker - Home</title>
      </Head>
      <div>Hello my Little friend</div>
    </Fragment>
  );
};

export default Home;
